import './App.css';
import './components'
import Glass from './components/backgrounds/glass';
import Textfield from './components/widgets/textfield';
import Button from './components/widgets/button';
import Profile from './components/widgets/profile';
import Icon from './components/widgets/icon';

function App() {
  return (
    <div className="App">
      <Glass />
      <Textfield name="email" icon="https://img.icons8.com/color/50/000000/email.png" cont="email" />
      <Button txt="click" />
      <Profile src="https://www.mockofun.com/wp-content/uploads/2019/12/circle-photo.jpg" />
      <Icon src="https://img.icons8.com/material-outlined/50/000000/search--v1.png" />
    </div>
  );
}

export default App;
